drop table visit;
create table visit (
	id INT,
	visit_type VARCHAR(3),
	admit_datetime DATE,
	length_of_stay INT,
	department VARCHAR(50),
	patient_id INT,
	PRIMARY KEY(id),
	CONSTRAINT fk_patient
	FOREIGN KEY(patient_id) 
	  REFERENCES patient(id)
);
